import React from "react";
import { Col, Row } from "antd";

const Main = () => {
  return (
    <Row>
      <Col span={8}>
        Satellites
      </Col>
      <Col span={16}>
        WorldMap
      </Col>
    </Row>
  )
}

export default Main;
